package com.roc.sequence.factory;public class SequenceException extends RuntimeException {    private static final long serialVersionUID = -6896586285280037814L;    public SequenceException() {        super();    }    public SequenceException(String s) {        super(s);    }    public SequenceException(String message, Throwable cause) {        super(message, cause);    }    public SequenceException(Throwable cause) {        super(cause);    }}